        {
            picPreview.Refresh(); 
        }

        void chkBorderColor_Click(object sender, System.EventArgs e)
        {
            string s;
            if (chkBorderColor.Checked)
            {
                this.picPageItemBorderColor.Enabled = true;
                s = "1";
            }
            else
            {
                this.picPageItemBorderColor.Enabled = false;
                s = "0";
            }
            if (this.cboPageItemBorder.Items.Count < 0) return;
            switch (((CboItem)(this.cboPageItem.SelectedItem)).ItemData)
            {
                case 1:
                    myPageSetup.SetAttributes(PageSetupKey.ePage_PageHeaderBorderColor, s + myPageSetup.GetAttributes(PageSetupKey.ePage_PageHeaderBorderColor).ToString().Substring(1));
                    break;
                case 2:
                    myPageSetup.SetAttributes(PageSetupKey.ePage_MainTitleBorderColor, s + myPageSetup.GetAttributes(PageSetupKey.ePage_MainTitleBorderColor).ToString().Substring(1));
                    break;
                case 3:
                    myPageSetup.SetAttributes(PageSetupKey.ePage_SubTitleBorderColor, s + myPageSetup.GetAttributes(PageSetupKey.ePage_SubTitleBorderColor).ToString().Substring(1));
                    break;
                case 4:
                    myPageSetup.SetAttributes(PageSetupKey.ePage_HeaderBorderColor, s + myPageSetup.GetAttributes(PageSetupKey.ePage_HeaderBorderColor).ToString().Substring(1));
                    break;
                case 5:
                    myPageSetup.SetAttributes(PageSetupKey.ePage_BodyBorderColor,s + myPageSetup.GetAttributes(PageSetupKey.ePage_BodyBorderColor).ToString().Substring(1));
                    break;
                case 6:
                    myPageSetup.SetAttributes(PageSetupKey.ePage_TailBorderColor, s + myPageSetup.GetAttributes(PageSetupKey.ePage_TailBorderColor).ToString().Substring(1));
                    break;
                case 7:
                    myPageSetup.SetAttributes(PageSetupKey.ePage_PageFooterBorderColor, s + myPageSetup.GetAttributes(PageSetupKey.ePage_PageFooterBorderColor).ToString().Substring(1));
                    break;
                default:
                    return;
            }
        }

        void chkCenterV_CheckedChanged(object sender, System.EventArgs e)
        {
            if (!chkCenterV.Checked)
            {
                txtTop.Enabled = true;
                txtBottom.Enabled = true;
            }
            else
            {
                txtTop.Enabled = false;
                txtBottom.Enabled = false;
            }
        }

        void chkCenterH_CheckedChanged(object sender, System.EventArgs e)
        {
            if (!chkCenterH.Checked)
            {
